(1, 58, 'Home', 'home', '<p>This web site is maintained by <a title=\"North-West University Internal Audit\" href=\"https://intranet.nwu.ac.za/internal-audit\" target=\"_blank\" rel=\"noopener noreferrer\">North-West University Internal Audit</a> department.</p>\r\n<h3>Purpose</h3>\r\n<p>The purpose of these pages is to communicate letters, data and audit findings to you, our audit client. We may also request information and audit finding responses from you here.</p>\r\n<h3>Confidentiality</h3>\r\n<p>All information exchanged via these pages is <span style=\"text-decoration: underline;\">strictly confidential</span>.</p>', '', 1, 2, '2016-01-18 12:48:12', 842, '', '2018-11-26 06:56:58', 842, 0, '0000-00-00 00:00:00', '2016-01-18 12:48:12', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/03-Nwu-logo-graphic---Small.jpg\",\"float_intro\":\"right\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"images\\/03-Nwu-logo-graphic---Small.jpg\",\"float_fulltext\":\"right\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":\"https:\\/\\/intranet.nwu.ac.za\\/internal-audit\",\"urlatext\":\"NWU Internal Audit Intranet Page\",\"targeta\":\"1\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 13, 4, '', '', 1, 3567, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(2, 59, 'Admin', 'article-admin', '<h1>Admin</h1>\r\n<p>The admin page will display site tables and allow managers and administrators to add, edit and delete items.</p>\r\n<h2>Structure</h2>\r\n<table style=\"float: left;\" cellspacing=\"5\" cellpadding=\"5\">\r\n<tbody>\r\n<tr style=\"height: 10px;\">\r\n<td style=\"text-align: left;\">\r\n<p><a title=\"Users\" href=\"index.php/menu-admin/users\">Users</a></p>\r\n</td>\r\n<td style=\"text-align: left;\"> </td>\r\n<td style=\"text-align: left;\"> </td>\r\n<td style=\"text-align: left;\">\r\n<p>(Audit personnel)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><a title=\"Audit Assignments\" href=\"index.php/menu-admin/menu-admi-assignment\">Assignments</a></p>\r\n</td>\r\n<td> </td>\r\n<td> </td>\r\n<td>(Audit assignments)</td>\r\n</tr>\r\n<tr>\r\n<td> </td>\r\n<td><a title=\"Assignment Category\" href=\"index.php/menu-admin/menu-admi-assignment/menu-admi-assi-category\">Category</a></td>\r\n<td> </td>\r\n<td>(Assignment category) ex: Assignment, Private or Consultation</td>\r\n</tr>\r\n<tr>\r\n<td> </td>\r\n<td> </td>\r\n<td><a title=\"Assignment status\" href=\"index.php/menu-admin/menu-admi-assignment/menu-admi-assi-category/menu-admi-assi-status\">Status</a></td>\r\n<td>(Assignment progress) ex: In Progress, Draft or Completed</td>\r\n</tr>\r\n<tr>\r\n<td> </td>\r\n<td> </td>\r\n<td><a title=\"Type\" href=\"index.php/menu-admin/menu-admi-assignment/menu-admi-assi-category/menu-admi-assi-type\">Type</a></td>\r\n<td>(Assignment type) ex: Adhoc, Yearend, Continuous or Private</td>\r\n</tr>\r\n<tr>\r\n<td> </td>\r\n<td><a title=\"Origin\" href=\"index.php/menu-admin/menu-admi-assignment/menu-admi-assi-origin\">Origin</a></td>\r\n<td> </td>\r\n<td>(Assignment origin)</td>\r\n</tr>\r\n<tr>\r\n<td> </td>\r\n<td><a title=\"Report\" href=\"index.php/menu-admin/menu-admi-assignment/menu-admi-assi-report\">Report</a></td>\r\n<td> </td>\r\n<td>(Assignment report to whom)</td>\r\n</tr>\r\n<tr>\r\n<td> </td>\r\n<td><a title=\"Assignment Site\" href=\"index.php/menu-admin/menu-admi-assignment/menu-admi-assi-site\">Site</a></td>\r\n<td> </td>\r\n<td>(Assignment site or location)</td>\r\n</tr>\r\n<tr>\r\n<td> Workflow</td>\r\n<td> </td>\r\n<td> </td>\r\n<td> </td>\r\n</tr>\r\n<tr>\r\n<td> Reports</td>\r\n<td> </td>\r\n<td> </td>\r\n<td> </td>\r\n</tr>\r\n<tr>\r\n<td> Findings</td>\r\n<td> </td>\r\n<td> </td>\r\n<td> </td>\r\n</tr>\r\n<tr>\r\n<td> </td>\r\n<td> </td>\r\n<td> </td>\r\n<td> </td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>', '', 1, 2, '2016-01-18 12:48:38', 842, '', '2018-10-26 12:52:04', 842, 0, '0000-00-00 00:00:00', '2016-01-18 12:48:38', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 42, 3, '', '', 9, 395, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
