(687, 'ia_find_risk', 51, 'textarea', 'Risk', 0, '0000-00-00 00:00:00', '2018-11-14 17:41:50', 854, 'Python', '2018-11-18 06:16:15', 842, 0, 0, '', 0, 0, 7, 0, '', 1, 1, 0, 0, 0, 1, 0, 0, '{\"bootstrap_class\":\"input-xxlarge\",\"width\":\"40\",\"height\":\"6\",\"textarea_showlabel\":\"1\",\"textarea_placeholder\":\"\",\"use_wysiwyg\":\"0\",\"wysiwyg_extra_buttons\":\"1\",\"textarea_field_type\":\"TEXT\",\"textarea-showmax\":\"1\",\"textarea-maxlength\":\"1000\",\"textarea_limit_type\":\"word\",\"textarea-tagify\":\"0\",\"textarea_tagifyurl\":\"\",\"textarea-truncate-where\":\"0\",\"textarea-truncate-html\":\"0\",\"textarea-truncate\":\"0\",\"textarea-hover\":\"1\",\"textarea_hover_location\":\"top\",\"show_in_rss_feed\":\"0\",\"show_label_in_rss_feed\":\"0\",\"use_as_rss_enclosure\":\"0\",\"rollover\":\"* Audit Risk must be assessed properly \\u2013 important to meet the audit standards concerning errors, irregularities and illegal acts.\\r\\n\\r\\n* Audit testing is based on an assessment of audit risk.\\r\\n\\r\\n* Audit Risk=Inherent Risk + Control Risk + Detection Risk (Qualitative vs. Quantitative Assessment)\\r\\n\\r\\nAudit Risk\\r\\n\\r\\n    The risk that the auditor will not detect a significant problem in the area under review because of incorrect assessments of the other risks.\\r\\n\\r\\nInherent Risk\\r\\n\\r\\n    The risk that naturally exists in the area under review assuming no controls. Cash has a high inherent risk, your textbook may have a low inherent risk \\u2013 who wants to take it??\\r\\n\\r\\nControl Risk\\r\\n\\r\\n    The risk that errors, irregularities or illegal acts will not be prevented or detected by the internal control structure within a timely period.\\r\\n\\r\\nDetection Risk\\r\\n\\r\\n    The risk that a significant problem will go undetected because of errors on the part of the auditor in carrying out the audit program.\\r\\n\\r\\n\",\"tipseval\":\"0\",\"tiplocation\":\"top-left\",\"labelindetails\":\"0\",\"labelinlist\":\"