\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":13,\"ordering\":\"4\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"2515\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"\"}', 0),
(95, 5, 1, '', '2018-11-28 12:20:05', 842, 6167, 'eba59c61f39e20885374d950e12b0cb4ac5882c6', '{\"id\":5,\"asset_id\":\"70\",\"title\":\"Finding letter to client\",\"alias\":\"find-lett-clie\",\"introtext\":\"<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">Dear <strong>{ia_finding___ia_find_r1_mailto}<\\/strong>,<br \\/><\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">Our automated continuous audit system generated the following audit finding.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">You are listed as the <span style=\\\"text-decoration: underline;\\\">responsible person<\\/span> to comment and\\/or take action based on this finding. Please investigate and reply \\/ update our system with your remarks and \\/ or actions taken, by following links below. Your remarks would update our audit database, and your remarks would be included in our final audit rerport issued to all stakeholders.<br \\/><\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">Please follow this link {ia_finding___ia_find_edit} after you\'ve studied the audit finding to update our database.<\\/span><\\/p>\\r\\n<hr \\/>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\"><strong>Audit assignment:<\\/strong><\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">{ia_finding___ia_assi_auto}<\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\"><strong><span style=\\\"font-family: tahoma, arial, helvetica, sans-serif;\\\">Finding:<\\/span><\\/strong><\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">{ia_finding___ia_find_name} <br \\/><\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">{ia_finding___ia_find_desc}<\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\"><strong>Recommendation:<\\/strong><\\/span><\\/p>\\r\\n<p>{ia_finding___ia_find_recommend}<\\/p>\\r\\n<p><strong>More information:<\\/strong><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">{ia_finding___ia_find_disp}<\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">{ia_finding___ia_find_detl}<\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">{ia_finding___ia_find_list}<\\/span><\\/p>\\r\\n<hr \\/>\\r\\n<p><span style=\\\"text-decoration: underline; font-size: 10pt;\\\"><strong><span style=\\\"font-family: tahoma, arial, helvetica, sans-serif;\\\">We would appreciate feedback at your earliest convenience.<\\/span><\\/strong><\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">Many thanks.<br \\/><\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">Albert<\\/span><\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<p><span style=\\\"font-size: 10pt;\\\"><strong><span style=\\\"font-family: tahoma, arial, helvetica, sans-serif;\\\">Notes:<\\/span><\\/strong><\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\"><span class=\\\"ILfuVd NA6bn\\\">All <b>audit<\\/b> clients are required to provide a written <b>response<\\/b> to <b>audit<\\/b> findings. The <b>response<\\/b> represents management\'s plan for correcting or improving the finding situation. All <b>responses<\\/b> are included in the final <b>audit<\\/b> report that is distributed to senior management, the Board, and the external auditors.<\\/span><\\/span><\\/p>\\r\\n<p><strong>Writing an audit finding response can be relatively easy if the following guidelines are used:<\\/strong><\\/p>\\r\\n<ul>\\r\\n<li>Respond directly to the finding and its recommendation(s)<\\/li>\\r\\n<li>Provide specific actions that management commits to take to correct the finding<\\/li>\\r\\n<li>Make your response clear and concise.<\\/li>\\r\\n<li>Exclude information that is not pertinent to the finding or its corrective action plan<\\/li>\\r\\n<li>Identify specific positions, if applicable, responsible for implementation<\\/li>\\r\\n<li>Provide a specific and realistic timetable for implementation<\\/li>\\r\\n<\\/ul>\\r\\n<p><span style=\\\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\\\">\\u00a0<\\/span><\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"8\",\"created\":\"2018-11-05 14:12:52\",\"created_by\":\"842\",\"created_by_alias\":\"\",\"modified\":\"2018-11-28 12:20:05\",\"modified_by\":\"842\",\"checked_out\":\"842\",\"checked_out_time\":\"2018-11-28 12:19:17\",\"publish_up\":\"2018-11-05 14:12:52\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":25,\"ordering\":\"1\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"0\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"Automated email finding letter with invite to comment\"}', 0),
(96, 5, 1, '', '2018-11-29 10:17:45', 842, 6400, '868257ba54b324b5c6f53917972a829511e9a3a1', '{\"id\":5,\"asset_id\":\"70\",\"title\":\"Finding letter to client\",\"alias\":\"find-lett-clie\",\"introtext\":\"<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">Dear <strong>{ia_finding___ia_find_r1_mailto}<\\/strong>,<br \\/><\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">Our automated continuous audit system generated the following audit finding.<\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">You are listed as the <span style=\\\"text-decoration: underline;\\\">responsible person<\\/span> to comment and\\/or take action based on this finding. Please investigate and reply \\/ update our system with your remarks and \\/ or actions taken, by following links below. Your remarks would update our audit database, and your remarks would be included in our final audit rerport issued to all stakeholders.<br \\/><\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">First <a title=\\\"NWU Internal Audit\\\" href=\\\"http:\\/\\/ia-nwu.co.za\\/\\\" target=\\\"_blank\\\" rel=\\\"author noopener noreferrer\\\">login<\\/a> to our web, then:<\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">Follow this link {ia_finding___ia_find_edit} to record your response in our audit database.<\\/span><\\/p>\\r\\n<hr \\/>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\"><strong>Audit assignment:<\\/strong><\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">{ia_finding___ia_assi_auto}<\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\"><strong><span style=\\\"font-family: tahoma, arial, helvetica, sans-serif;\\\">Finding:<\\/span><\\/strong><\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">{ia_finding___ia_find_name} <br \\/><\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">{ia_finding___ia_find_desc}<\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\"><strong>Recommendation:<\\/strong><\\/span><\\/p>\\r\\n<p>{ia_finding___ia_find_recommend}<\\/p>\\r\\n<p><strong>More information:<\\/strong><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">{ia_finding___ia_find_disp}<\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">{ia_finding___ia_find_detl}<\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">{ia_finding___ia_find_list}<\\/span><\\/p>\\r\\n<hr \\/>\\r\\n<p><span style=\\\"text-decoration: underline; font-size: 10pt;\\\"><strong><span style=\\\"font-family: tahoma, arial, helvetica, sans-serif;\\\">We would appreciate feedback at your earliest convenience.<\\/span><\\/strong><\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">Many thanks.<br \\/><\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\">Albert<\\/span><\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<p><span style=\\\"font-size: 10pt;\\\"><strong><span style=\\\"font-family: tahoma, arial, helvetica, sans-serif;\\\">Notes:<\\/span><\\/strong><\\/span><\\/p>\\r\\n<p><span style=\\\"font-size: 10pt; font-family: tahoma, arial, helvetica, sans-serif;\\\"><span class=\\\"ILfuVd NA6bn\\\">All <b>audit<\\/b> clients are required to provide a written <b>response<\\/b> to <b>audit<\\/b> findings. The <b>response<\\/b> represents management\'s plan for correcting or improving the finding situation. All <b>responses<\\/b> are included in the final <b>audit<\\/b> report that is distributed to senior management, the Board, and the external auditors.<\\/span><\\/span><\\/p>\\r\\n<p><strong>Writing an audit finding response can be relatively easy if the following guidelines are used:<\\/strong><\\/p>\\r\\n<ul>\\r\\n<li>Respond directly to the finding and its recommendation(s)<\\/li>\\r\\n<li>Provide specific actions that management commits to take to correct the finding<\\/li>\\r\\n<li>Make your response clear and concise.<\\/li>\\r\\n<li>Exclude information that is not pertinent to the finding or its corrective action plan<\\/li>\\r\\n<li>Identify specific positions, if applicable, responsible for implementation<\\/li>\\r\\n<li>Provide a specific and realistic timetable for implementation<\\/li>\\r\\n<\\/ul>\\r\\n<p><span style=\\\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\\\">\\u00a0<\\/span><\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"8\",\"created\":\"2018-11-05 14:12:52\",\"created_by\":\"842\",\"created_by_alias\":\"\",\"modified\":\"2018-11-29 10:17:45\",\"modified_by\":\"842\",\"checked_out\":\"842\",\"checked_out_time\":\"2018-11-29 10:13:17\",\"publish_up\":\"2018-11-05 14:12:52\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags