(98, 5, 1, '', '2018-11-29 12:01:02', 842, 4433, '1d141e180b97f6d2a64a5358feb3d2634780832e', '{\"id\":5,\"asset_id\":\"70\",\"title\":\"Finding letter to client\",\"alias\":\"find-lett-clie\",\"introtext\":\"<p>Dear <strong>{ia_finding___ia_find_r1_mailto}<\\/strong>,<\\/p>\\r\\n<p>Our automated continuous audit system generated the following audit finding.<\\/p>\\r\\n<p>You are listed as the <span style=\\\"text-decoration: underline;\\\">responsible person<\\/span> to comment and\\/or take action based on this finding. Please investigate and reply \\/ update our system with your remarks and \\/ or actions taken, by following links below. Your remarks would update our audit database, and your remarks would be included in our final audit rerport issued to all stakeholders.<\\/p>\\r\\n<p>First <a title=\\\"NWU Internal Audit\\\" href=\\\"http:\\/\\/ia-nwu.co.za\\/\\\" target=\\\"_blank\\\" rel=\\\"author noopener noreferrer\\\">login<\\/a> to our web, then:<\\/p>\\r\\n<p>Follow this link {ia_finding___ia_find_edit} to record your response in our audit database.<\\/p>\\r\\n<hr \\/>\\r\\n<p><strong>Audit assignment:<\\/strong><\\/p>\\r\\n<p>{ia_finding___ia_assi_auto}<\\/p>\\r\\n<p><strong>Finding:<\\/strong><\\/p>\\r\\n<p>{ia_finding___ia_find_name} <\\/p>\\r\\n<p>{ia_finding___ia_find_desc}<\\/p>\\r\\n<p><strong>Recommendation:<\\/strong><\\/p>\\r\\n<p>{ia_finding___ia_find_recommend}<\\/p>\\r\\n<p><strong>More information:<\\/strong><\\/p>\\r\\n<p>{ia_finding___ia_find_disp}<\\/p>\\r\\n<p>{ia_finding___ia_find_detl}<\\/p>\\r\\n<p>{ia_finding___ia_find_list}<\\/p>\\r\\n<hr \\/>\\r\\n<p><span style=\\\"text-decoration: underline;\\\"><strong>We would appreciate feedback at your earliest convenience.<\\/strong><\\/span><\\/p>\\r\\n<p>Many thanks.<\\/p>\\r\\n<p>Albert<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<p><strong>Notes:<\\/strong><\\/p>\\r\\n<p><span class=\\\"ILfuVd NA6bn\\\">All <b>audit<\\/b> clients are required to provide a written <b>response<\\/b> to <b>audit<\\/b>