(1, 855, 10, 'Epos na nuwe gebruiker', '<p><span style=\"font-size: 10pt;\">Geagte Kollega,</span></p>\r\n<p><span style=\"font-size: 10pt;\">Aangesien daar na u in Interne Oudit korrespondensie verwys word, en daar met elektroniese epos gekommunikeer word in verband hiermee, moet ons u op ons Interne Oudit webblad (ia-nwu.co.za) registreer.</span></p>\r\n<p><span style=\"font-size: 10pt;\">Sodra registrasie plaasvind, sal u \'n epos ontvang vanaf NWU Internal Audit met die volgende strekking:</span></p>\r\n<p><span style=\"font-size: 10pt;\"><strong>Onderwerp:</strong> Account Details for (u titel, voorletters en van) at NWU Internal Audit</span></p>\r\n<p><span style=\"font-size: 10pt;\"><strong>Boodskap:</strong> Hello (u titel, voorletters en van), Thank you for registering at NWU Internal Audit. You may now log in to <a href=\"http://ia-nwu.co.za/\">http://ia-nwu.co.za/</a> using the username and password you registered with.</span></p>\r\n<p><span style=\"font-size: 10pt;\">Gebruik asseblief die volgende gebruikersnaam en wagwoord:</span></p>\r\n<p><span style=\"font-size: 10pt;\"><strong>Username:</strong> U personeelnommer (bv 15847939)</span></p>\r\n<p><span style=\"font-size: 10pt;\"><strong>Password:</strong> NwuiA12345 (Wagwoord is hoofletter sensitief)</span></p>\r\n<p><span style=\"font-size: 10pt;\"><span style=\"text-decoration: underline;\">Sodra u die eerste maal aanteken, sal u versoek word om u wagwoord te verander</span>. \'n Wagwoord moet ten minste 10 karakters lank wees, en moet 2 hoofletters en twee numeriese karakters bevat. Interne Oudit het nie toegang tot hierdie wagwoord, en dit verander ook nie vanself van tyd tot tyd nie. U kan wel self die wagwoord verander, deur gebruik te maak van die \"Forget your password?\" funksie.</span></p>\r\n<p><span style=\"font-size: 10pt;\">U mag van tyd tot tyd korrespondensie vanaf ons via die webblad ontvang. Die epos sal altyd gerig wees aan u persoonlik, met u <strong>TITEL, VOORLETTERS en VAN in hoofletters</strong>. Die epos sal ook meld dit dit afkomstig is vanaf <strong>NWU Internal Audit</strong>. Ons ontvang ook met groot waardering enige kommentaar en voorstelle om die webblad te verbeter.</span></p>\r\n<p><span style=\"font-size: 10pt;\">Baie dankie vir u deelname.</span></p>', 1, 0, '0000-00-00 00:00:00', 842, '2018-11-20 07:55:44', 842, '2018-11-20 09:39:26', '2018-11-20 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00');

